// @name         Scriptacide
// @description  Basic script with eruda console and script loader
// @author       Micah Sanchez
// @version      1.3
// @match        *://*/*

(function () {
  // Function to load external scripts
  function loadScript(url) {
    var script = document.createElement('script');
    script.type = 'text/javascript';
    script.src = url;
    document.head.appendChild(script);
  }

  // Function to prompt for custom script URL
  function promptForScriptUrl() {
    var customScriptUrl = prompt('Enter the URL of your custom script:');
    if (customScriptUrl) {
      loadScript(customScriptUrl);
    }
  }

  // Hardcoded Eruda script in base64
  var erudaBase64 = '';
  var erudaScript = document.createElement('script');
  erudaScript.type = 'text/javascript';
  erudaScript.innerHTML = atob(erudaBase64);
  document.head.appendChild(erudaScript);

  // Enable Eruda console
  eruda.init();

  // Load Script button
  var loadScriptButton = document.createElement('button');
  loadScriptButton.textContent = 'Load Script';
  loadScriptButton.style.position = 'fixed';
  loadScriptButton.style.top = '10px';
  loadScriptButton.style.right = '10px';
  loadScriptButton.style.zIndex = '9999';
  loadScriptButton.onclick = promptForScriptUrl;
  document.body.appendChild(loadScriptButton);

  // Alert upon loading
  alert('Loaded successfully');
})();
